import appLocaleData from "react-intl/locale-data/uz";
import uzMessages from "../locales/uz_UZ.json";

const UzLang = {
  messages: {
    ...uzMessages
  },
  antd: null,
  locale: 'uz',
  data: appLocaleData
};
export default UzLang;
